#include <iostream>
#include <vector>
#include <queue>
#include <utility>
#include <algorithm>
using namespace std;

class Solution{
public:
	int numIsland(vector<vector<char>>& grid){
		vector<vector<int>>  grid_shadow, grid_ss;

		for(int i=0; i<grid.size(); i++){
			vector<int> vi(grid[i].size());
			vector<int> vi2(grid[i].size());
			grid_shadow.push_back(vi);
			grid_ss.push_back(vi2);
		}

		/* first check to get base island. not final. */
		int number = 1;
		vector<int> vn;
		int xsize = grid.size();
		for(int i=0; i<xsize; i++ ){
			for(int j=0; j<grid[i].size(); j++){
				if(grid[i][j] == '1'){
					grid_shadow[i][j] = number++;
				} else {
					grid_ss[i][j] = 1;
				}
			}
		}

//		cout << "total 1 number: " << vn.size() << endl;
//		show(grid_shadow);

		for(int i=0; i<grid.size(); i++){
//			cout << grid.size() << ", ";
			for(int j=0; j<grid[i].size(); j++){
//				cout << grid[i].size() << "\n";
				if(grid_shadow[i][j] > 0){
					int min_num = getMinimum(grid_shadow, grid_ss, i, j);
					vn.push_back(min_num);
////					show(grid_shadow);
				}
			}
		}

//		show(grid_shadow);

		sort(vn.begin(), vn.end());
		auto it = unique(vn.begin(), vn.end());
		vn.resize( distance(vn.begin(), it) );

		return vn.size();
	}

	void show(vector<vector<int>>& grid){
//		cout << "show \n";
		for(auto& x : grid){
			for(auto& xx : x){
				printf("%3d, ", xx);
			}
//			cout << endl;
		}
	}

	int getMinimum(vector<vector<int>>& grid, vector<vector<int>>& shadow, int i, int j){
		int min_num = grid[i][j];
////		cout << "get "<< i << " " << j << ": " << min_num << "\n";
		shadow[i][j] = 1;
		if(i != grid.size()-1){
			if(grid[i+1][j] > 0 ){
				if(min_num > grid[i+1][j]){
					min_num = grid[i+1][j];
					grid[i][j] = min_num;
				} else {
					grid[i+1][j] = min_num;
				}
				if(!shadow[i+1][j]){
					int min_num2 = getMinimum(grid, shadow, i+1, j);
					if(min_num > min_num2){
						min_num = min_num2;
						grid[i][j] = min_num;
						grid[i+1][j] = min_num;
					}
				}
			}
		}
		if(j != grid[i].size()-1){
			if(grid[i][j+1] > 0){
				if(min_num > grid[i][j+1]){
					min_num = grid[i][j+1];
					grid[i][j] = min_num;
				} else {
					grid[i][j+1] = min_num;
				}
				if(!shadow[i][j+1]){
					int min_num2 = getMinimum(grid, shadow, i, j+1);
					if(min_num > min_num2){
						min_num = min_num2;
						grid[i][j] = min_num;
						grid[i][j+1] = min_num;
					}
				}
			}
		}
		if(i != 0){
			if(grid[i-1][j] > 0){
				if(min_num > grid[i-1][j]){
					min_num = grid[i-1][j];
					grid[i][j] = min_num;
				} else {
					grid[i-1][j] = min_num;
				}
				if(!shadow[i-1][j]){
					int min_num2 = getMinimum(grid, shadow, i-1, j);
					if(min_num > min_num2){
						min_num = min_num2;
						grid[i][j] = min_num;
						grid[i-1][j] = min_num;
					}
				}
			}
		}
		if(j != 0){
			if(grid[i][j-1] > 0){
				if(min_num > grid[i][j-1]){
					min_num = grid[i][j-1];
					grid[i][j] = min_num;
				} else {
					grid[i][j-1] = min_num;
				}
				if(!shadow[i][j-1]){
					int min_num2 = getMinimum(grid, shadow, i, j-1);
					if(min_num > min_num2){
						min_num = min_num2;
						grid[i][j] = min_num;
						grid[i][j-1] = min_num;
					}
				}
			}
		}
		return min_num;
	}
};

